import React, { Component } from "react";

export default class Counter extends Component {
  state = {
    count: 0,
  };

  render() {
    return (
      <div>
        <span>{this.state.count}</span>
        <button className="btn btn-primary">Increase</button>
      </div>
    );
  }
}
